import React from 'react'
import { useGlobalContext } from './context';

function Restaurant() {
    const { venues } = useGlobalContext();

    return (
        <div>
            <ul>
                {venues.map((venue)=>(
                    <ul>

                        <li key={venue.id}>{venue.location.city}</li>
                        <li key={venue.id}>{venue.name}</li>
                        <li key={venue.id}>{venue.location.neighborhood}</li>
                        <li key={venue.id}>{venue.categories.name}</li>
                        
                    </ul>
                    ))}
            </ul>
        </div>
    )
}

export default Restaurant
